css:
.top-bar {
    font-size: 95%;
    background-color: #d690a9; 
}
.header {
    border-bottom: 1px solid #88888840;
    box-shadow: var(--box-shadow-lg);
    z-index: 900;
}

.top-bar__nav {
    max-width: 80rem;
    color: #ffffff;
    margin-left: auto;
    margin-right: auto;
    padding: var(--spacer-2) var(--spacer-2) var(--spacer-1);
}

.header__nav a {
    color: #817f88;
    padding-right: 1rem;
}



.info-bar {
  background: #d690a9;
}

@media (min-width: 992px)
.col-lg-auto {
    flex: 0 0 auto;
    width: auto;
    max-width: 100%;
}

@media (min-width: 992px)
.col-lg-3 {
    flex: 0 0 25%;
    max-width: 25%;
}

@media (min-width: 992px)
.col-lg {
    flex-basis: 0;
    flex-grow: 1;
    max-width: 25%;

}

.header__nav {
    text-align: initial;
    font-size: var(--font-size-base); 
    line-height: var(--line-height-bas);
    line-height: var(--line-height-lg);
    margin-top: 30px;
    margin-bottom: 10px;
}

.footer {
  background: #3b9475;    
  color: #ffffff;    
}

.footer__store, .footer__credits, .footer__title, .footer a, .footer i {
    color: #ffffff;
}

.ecom-credits {
    background: #3b9475;
    color: #ffffff;
}

.breadcrumb a {
    color: hsl(253deg 4% 54%);
}

.btn-primary {
    color: #fff;
    background-color: #d690a9;
    border-color: #d690a9;
}

.btn-primary.focus, .btn-primary:focus, .btn-primary:hover {
    color: #fff;
    background-color: #d690a9;
    border-color: #d690a9;
 }

.prices__value {
    font-size: x-large;
    font-weight: 400;
    color: #d690a9;
}

.minicart__subtotal {
    text-align: right;
    color: #888;
}]

.product-card__name {
   padding-top: var(--spacer-2);
   font-size: var(--font-size-m);
   height: calc(var(--line-height-sm)*var(--font-size-sm)*2);
}
